import React, {Component} from 'react';

class TopBar extends Component {
    render() {
        return (
            <div className="navbar navbar-light bg-light">
                <a className="navbar-brand" href="#">
                    Hoaxify
                </a>

            </div>
        );
    }
}

export default TopBar;
